import React, { useState } from 'react';
import MovieCarousel from './Components/MovieCarousel';
import MovieDetails from './Components/MovieDetails';
import SeatSelection from './Components/SeatSelection';
import FoodSelection from './Components/FoodSelection';
import PaymentProcessing from './Components/PaymentProcessing';

const App = () => {
  const [selectedMovie, setSelectedMovie] = useState(null);
  const [isBooking, setIsBooking] = useState(false);
  const [isSelectingFood, setIsSelectingFood] = useState(false);
  const [isPaying, setIsPaying] = useState(false);
  const [totalCost, setTotalCost] = useState(0);

  const movies = [
    { id: 1, title: 'Avatar', poster: 'data:image/jpeg;base64,' },
    { id: 2, title: 'Rapidos y Furiosos X', poster: 'data:image/jpeg;base64,' },
    { id: 3, title: 'Intensamente 2', poster: 'data:image/jpeg;base64,' },
    { id: 4, title: 'El Rey Leon 2', poster: 'data:image/jpeg;base64,' },
  ];

  return (
    <div className="App">
      <h1>Cine</h1>
      {!selectedMovie && !isBooking && !isSelectingFood && !isPaying && (
        <MovieCarousel movies={movies} onSelectMovie={(movie) => setSelectedMovie(movie)} />
      )}
      {selectedMovie && !isBooking && !isSelectingFood && !isPaying && (
        <MovieDetails
          movie={selectedMovie}
          onBook={() => setIsBooking(true)}
          onBack={() => setSelectedMovie(null)}
        />
      )}
      {isBooking && !isSelectingFood && !isPaying && selectedMovie && (
        <SeatSelection
          movie={selectedMovie}
          onBack={() => {
            setIsBooking(false);
            setSelectedMovie(null);
          }}
          onConfirm={(cost) => {
            setTotalCost(cost);
            setIsSelectingFood(true);
          }}
        />
      )}
      {isSelectingFood && !isPaying && (
        <FoodSelection
          onBack={() => {
            setIsSelectingFood(false);
            setSelectedMovie(null);
          }}
          onConfirm={(foodCost) => {
            setTotalCost(totalCost + foodCost);
            setIsPaying(true);
          }}
        />
      )}
      {isPaying && (
        <PaymentProcessing
          totalCost={totalCost}
          onBack={() => {
            setIsPaying(false);
            setSelectedMovie(null);
          }}
          onComplete={() => {
            setIsPaying(false);
            setSelectedMovie(null);
            setIsBooking(false);
            setIsSelectingFood(false);
            setTotalCost(0);
          }}
        />
      )}
    </div>
  );
};

export default App;